import React from "react";
import { Row, Col } from "antd";

import Card from "../../../components/common/Card";

const Search = () => {
  return (
    <div className="search-page">
      <h2>Search results for: history</h2>
      <Row gutter={[16, 16]}>
        <Col xs={24} sm={12} lg={8} xl={6}>
          <Card />
        </Col>
      </Row>
    </div>
  );
};

export default Search;
